function getIndexByHandle(myArray, fileId) {
  for (var i = 0; i < myArray.length; i++) {
    if (myArray[i].handle === fileId) {
      return i;
    }
  }
}

function getIndexByRelativeURL(myArray, fileId) {
  for (var i = 0; i < myArray.length; i++) {
    if (myArray[i].relative_url === fileId) {
      return i;
    }
  }
}

