function titleCase(str) {
  if (!str) return;
  return str.charAt(0).toUpperCase() + str.toLowerCase().substring(1);
}

function isIE() {
  var myNav = navigator.userAgent.toLowerCase();
  return myNav.indexOf('msie') != -1 ? parseInt(myNav.split('msie')[1]) : false;
}
